import { warn } from 'react-instantsearch-hooks';
process.env.NODE_ENV === 'development' ? warn(Date.now() < new Date('2023-08-09').getTime(), 'The package `react-instantsearch-hooks-web` is replaced by `react-instantsearch`. The API is the same, but the package name has changed. Please update your dependencies and follow the migration guide: https://www.algolia.com/doc/guides/building-search-ui/upgrade-guides/react/') : void 0;
export * from 'react-instantsearch-hooks';
export * from "./widgets/index.js";
